// 1. fullNmae을 LastName만 있도록 바꾸고 소문자화하고,
// time을 AM, PM 없애고 -> 24시화 하기
// ex) 4:27 PM -> 16:27
// timeZone을 앞에 대륙만 남기도록 하기
const quiz1 = data.map((v, i) => {
  v.fullName = v.fullName.split(" ")[1].toLowerCase();

  let [timeStr, ampm] = v.time.split(" "); // ["4:50", "PM"]
  let [hour, minute] = timeStr.split(":").map((v) => Number(v));
  if (ampm === "PM" && hour !== 12) hour += 12;
  if (ampm === "AM" && hour === 12) hour = 0;
  v.time = `${String(hour).padStart(2, "0")}:${String(minute).padStart(2, "0")}`;
  v.time = `${v.time.split(" ")[0]}`;

  v.timeZone = v.timeZone.split("/")[0];

  return v;
});
console.log("quiz1:", quiz1);

// 2. 도메인이 .com인 사람만 남기고
// fullName과 money와 email만 나타나도록 하기
// 대신에 fullName은 firstName만 나타나게 하고
// money는 원화로 바꾸고
// email은 @앞에 아이디만 남기도록 하기
const quiz2 = data
  .filter((v, i) => v.domain.endsWith(".com"))
  .map((v, i) => ({
    fullName: v.fullName.split(" ")[0],
    money: `${parseInt(v.money.replace("$", "")) * 1393.1}원(KRW)`,
    email: v.email.split("@")[0],
  }));
console.log("quiz2:", quiz2);
